import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // The provided JS relies on a #mainContent div which is missing in the HTML.
    // We inject it to allow the script to run as intended.
    await page.evaluate(() => {
      const mainContentDiv = document.createElement('div');
      mainContentDiv.id = 'mainContent';
      document.body.appendChild(mainContentDiv);
    });

    // The profile links lack onclick handlers. We directly call the JS function to render the profile.
    await page.evaluate(() => {
      // @ts-ignore
      showProfile();
    });

    // Wait for the profile page content to be rendered
    await page.waitForSelector('.profile-page', { timeout: 5000 });

    // Take a screenshot of the profile page
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_profile_page.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_profile_page.png'));

    // Extract user profile information
    const fullName = await page.locator('.profile-info h2').textContent();
    const username = await page.locator('.profile-info .username').textContent();
    const bio = await page.locator('.profile-info .bio').textContent();
    const totalOrders = await page.locator('.profile-stats .stat-number').nth(0).textContent();
    const totalReviews = await page.locator('.profile-stats .stat-number').nth(1).textContent();
    const sellerRating = await page.locator('.profile-stats .stat-number').nth(2).textContent();

    const extractedData = {
      fullName: fullName?.trim(),
      username: username?.trim(),
      bio: bio?.trim(),
      stats: {
        totalOrders: totalOrders?.trim(),
        totalReviews: totalReviews?.trim(),
        sellerRating: sellerRating?.trim()
      }
    };

    return {
      success: true,
      action: "Successfully harvested user profile information.",
      extractedData,
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to harvest user profile information.",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
